import React from 'react'

function Card({img, title, diets}) {
    return (
         <div>
            {
                <div>
                    <img src={img} alt="img not found" />
                    <h1>{title}</h1>
                    {diets.map((diet, index)=> <li key={index}>{diet}</li>)}
                    <hr />
                </div>
            }
        </div>

    )
}

export default Card
